import{_ as e}from"./0内容列表-目录-63164f69.js";import{_ as a,o as d,c,a as i}from"./app-c80e1060.js";const o="/assets/0全局设置1-b0f02323.png",s="/assets/0快捷命令编辑器-b9149246.png",r="/assets/0输入拦截-底部-17ba319e.png",t="/assets/0内容列表-图层-2e9d1277.png",p="/assets/0内容列表-文档-60e8400a.png",h="/assets/0内容列表-工具箱-c61b9179.png",l="/assets/0自定义工具集-cb113a14.png",n="/assets/0编辑自定义工具-52a31bad.png",m="/assets/0状态栏-62ac97dc.png",g="/assets/0关于-72556028.png",_={},u=i('<h1 id="其他" tabindex="-1"><a class="header-anchor" href="#其他" aria-hidden="true">#</a> 其他</h1><h2 id="全局设置" tabindex="-1"><a class="header-anchor" href="#全局设置" aria-hidden="true">#</a> 全局设置</h2><p>命令 <code>GCC</code>，控制一些全局选项，选中设置项后下方有关于该设置的说明。</p><p><img src="'+o+'" alt="image-20230809113009260"></p><h2 id="快捷命令" tabindex="-1"><a class="header-anchor" href="#快捷命令" aria-hidden="true">#</a> 快捷命令</h2><p>命令 <code>PGP</code>，用于自定义快捷命令，默认会添加本软件的所有命令。</p><p><img src="'+s+'" alt="image-20230809121552060"></p><h5 id="重置所有命令" tabindex="-1"><a class="header-anchor" href="#重置所有命令" aria-hidden="true">#</a> 重置所有命令</h5><p>将本软件所有快捷命令恢复到默认值，该操作会清除所有用户自定义命令，请注意备份</p><h5 id="打开配置csv" tabindex="-1"><a class="header-anchor" href="#打开配置csv" aria-hidden="true">#</a> 打开配置CSV</h5><ul><li>以默认应用打开配置CSV文件，可直接编辑后保存，该文件保存在 spatialbox_alias.csv 中</li><li>用默认应用打开配置CSV后，CAD界面会锁定直到该默认应用关闭，自动刷新命令列表</li><li><code>CSV</code> 文件请保存为 <code>UTF-8</code> 编码（通过文本编辑器打开，另存时可选择编码）</li></ul><p>双击命令可直接编辑，右键可添加和删除命令</p><h2 id="输入拦截" tabindex="-1"><a class="header-anchor" href="#输入拦截" aria-hidden="true">#</a> 输入拦截</h2><p>输入拦截开启后，可在中文输入法状态下直接输入命令，无需手动切换到英文，可通过命令 <code>IMES</code> 进行设置，也可以单击底部菜单栏快速开启或关闭</p><p><img src="'+r+'" alt="image-20230809122232367"></p><h2 id="图层" tabindex="-1"><a class="header-anchor" href="#图层" aria-hidden="true">#</a> 图层</h2><p><code>内容列表</code> &gt; <code>图层</code> 可切换到图层选项卡，这是一个简单的资源管理器，分为 <code>图层</code> <code>影像</code> <code>表</code> 三种节点，分别提供相应的功能。</p><p><img src="'+t+'" alt="image-20230809141733753"></p><ul><li><code>鼠标中键</code>：鼠标悬浮于图层上，按下中键可将该图层切换为当前图层</li><li><code>左键双击</code>：鼠标悬浮于图层上，左键双击可打开该图层属性表</li><li><code>Delete</code>：选中图层节点（可多选）后按 Delete 键，可快速删除图层；</li><li><code>鼠标右键</code>：打开右键菜单，各种节点菜单各不相同，不予赘述。</li></ul><h2 id="文档" tabindex="-1"><a class="header-anchor" href="#文档" aria-hidden="true">#</a> 文档</h2><p><code>内容列表</code> &gt; <code>文档</code> 可切换到文档选项卡，提供快速切换、关闭文档等功能</p><p><img src="'+p+'" alt="image-20230809141937827"></p><h2 id="目录" tabindex="-1"><a class="header-anchor" href="#目录" aria-hidden="true">#</a> 目录</h2><p><code>内容列表</code> &gt; <code>目录</code> 可切换到目录选项卡，提供快速管理图层、加载数据和转换数据等功能</p><p><img src="'+e+'" alt="image-20230809142149198"></p><h2 id="工具箱" tabindex="-1"><a class="header-anchor" href="#工具箱" aria-hidden="true">#</a> 工具箱</h2><p><code>内容列表</code> &gt; <code>工具箱</code> 切换到工具箱选项卡，里面整合了大部分工具及命令，可通过关键字快速搜索并定位到指定工具</p><p><img src="'+h+'" alt="image-20230809143459997"></p><ul><li>命令 <code>SBOX</code> 通过以窗口状态打开工具箱，直接选择要执行的命令。</li><li>可通过首字母打开对应工具集，如：栅格工具（<code>SG</code>），属性管理（<code>SX</code>）。</li><li>鼠标停留在工具上，会出现关于该工具的快捷命令及用途描述。</li><li>通过顶部的搜索栏可进行关键字搜索，支持首字母搜索。</li></ul><h3 id="编辑自定义工具" tabindex="-1"><a class="header-anchor" href="#编辑自定义工具" aria-hidden="true">#</a> 编辑自定义工具</h3><p>工具箱左下有个 <code>自定义</code> 按钮，可按需要将命令添加到工具箱中。</p><p><img src="'+l+'" alt="image-20231015180932119"></p><p>点击 <code>自定义</code> 后，弹出命令编辑窗口，该编辑器中的内容和工具箱中的自定义项目一一对应</p><p><img src="'+n+'" alt="image-20231015181341781"></p><p>具体而言：</p><p>工具集：左侧列表中是工具集，编辑时用中括号包裹，如：<code>[示例1]</code> <code>[示例2]</code> ，不能重复</p><p>工具组：右侧深色标签是工具组，编辑时用尖括号包裹，如：<code>&lt;绘图&gt;</code> <code>&lt;栅格&gt;</code></p><p>工具：其他则是自定义的工具，格式为：工具名称,命令,功能描述，用英文逗号分隔，可使用组合命令</p><p>编辑后确定，工具箱自动刷新</p><blockquote><p>注：</p><ul><li><p>自定义工具只是向命令行发送命令，不支持诸如 <code>F1</code>，<code>Ctrl+S</code> 等快捷键</p></li><li><p>自定义工具保存在 <code>安装目录\\user\\usercmd.ini</code> 中，卸载时若有必要，请注意备份</p></li><li><p>在 <code>安装目录\\user\\userimage</code> 中，可设置和工具集同名的图标，图标格式为png，尺寸不超过32*32，如 <code>示例1.png</code></p></li></ul></blockquote><h2 id="状态栏" tabindex="-1"><a class="header-anchor" href="#状态栏" aria-hidden="true">#</a> 状态栏</h2><p>左键单击状态栏图斑，可快速开启/关闭内容列表，右键可打开常用功能菜单</p><p><img src="'+m+'" alt="image-20230809140941205"></p><ul><li>顶部菜单也就是传统菜单，简单实用，仅占用少量屏幕空间</li><li>Ribbon菜单在某些情况下可能需要点击两次才能正常显示</li></ul><h2 id="关于" tabindex="-1"><a class="header-anchor" href="#关于" aria-hidden="true">#</a> 关于</h2><p>命令 <code>SINFO</code>，显示当前的版本信息，若有新版本也会提示更新。</p><p><img src="'+g+'" alt="image"></p><h2 id="日志" tabindex="-1"><a class="header-anchor" href="#日志" aria-hidden="true">#</a> 日志</h2><p>命令 <code>SLOG</code>，动态显示软件运行日志，功能完善中。</p>',49),b=[u];function f(x,S){return d(),c("div",null,b)}const O=a(_,[["render",f],["__file","08Others.html.vue"]]);export{O as default};
